import { useState, useEffect } from 'react';
import './Home.css';
import Profile from './Profile';

function Home() {
  const [user, setUser] = useState({ id: null, username: null });
  useEffect(() => {
    setUser({ id: Profile.getId()});
  }, [])
  useEffect(() => {
    setUser({ username: Profile.getUsername() });
  }, [])
  console.log(user.id);
  console.log(user.username);













  return (
    <div className="Home">


      <div className="content">
        <p>Home page.</p>
        <br></br><br></br>

      </div>
      {user.username}
    </div>
  )
};

export default Home;
